import React, { Component} from 'react';


class SearchBar extends Component {
    constructor(){
        super();
        this.searchData = this.searchData.bind(this);

    }
    render () {
      return(
        <div >
          <input onChange={this.props.search} placeholder="Search users" />
        </div>
      )
    }
  }
  export default SearchBar;
